import React from 'react';
import Title from './Title';
import planets from '../data/planets';

class Solar extends React.Component {
  render() {
    return (
      <>
        <div data-testid="solar-system"><Title headline="Planetas" /></div>
        <PlanetCard />
      </>
    );
  }
}

export default Solar;
